import React from "react";
import User from "./User";

class Users extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      users: [
          {
            id: 1,
            firstname: "Vadim",
            lastname: "Khakimyanov",
            bio: 'Программист получаеца',
            age: 27,
            isHappy: true
        },
        {
            id: 2,
            firstname: "Ruslan",
            lastname: "Melnikov",
            bio: 'Не-промоутер получаеца',
            age: 18,
            isHappy: true
      },
      {
        id: 3,
        firstname: "Naruto",
        lastname: "Uzumaki",
        bio: 'Хокаге получаеца',
        age: 35,
        isHappy: false
      },
    ]   
  }
}

render() {
  if (this.state.users.length > 0)
    return (
      <>
        {this.state.users.map((e) => (
              <User key={e.id} />
            ))}
        </>)
    else 
      return (
            <div className="bg-users">
                <h3>Все уехали</h3>
            </div>
            )
    }
}

export default Users
